import { Tab, Tabs } from 'react-bootstrap';

function TabsRow() {
    return (
        <div style={{ display: 'flex', justifyContent: 'center' }}>
            <Tabs defaultActiveKey="home" id="uncontrolled-tab-example" className="mb-3" style={{ fontSize: '0.5em' }}>
                <Tab eventKey="home" title="Tokens" style={{ padding: '10px' }}>
                    Token content
                </Tab>
                <Tab eventKey="profile" title="NFTs" style={{ padding: '10px' }}>
                    NFTs content
                </Tab>
                <Tab eventKey="messages" title="Activity" style={{ padding: '10px' }}>
                    Activity content
                </Tab>
            </Tabs>
        </div>
    );
}

export default TabsRow;
